import React from 'react'
import Advertise from './advertise'

export const Home = () => {
  console.log('Home component is rendering');
  
  return (
    <div style={{ minHeight: '500px', background: '#f8f9fa' }}>
      <h2 style={{ textAlign: 'center', padding: '20px' }}>Home Page</h2>
      <Advertise />
      <div style={{ padding: '20px', textAlign: 'center' }}>
        <p>Other home content goes here...</p>
      </div>
    </div>
  )
}

export default Home;
